import React from 'react';
import TeamMember from './TeamMember';

function Team(){

const info=[

    {
        id: 1,
        img: 'https://picsum.photos/70',
        name: 'Raghad Alahmadi',
        position: 'Programmer',
        phone: '+123 456 789',
        email: 'raghad@gmail.com',
        website: 'www.raghadalahmadi.com',
    },
   {
        id: 3,
        img: 'https://picsum.photos/73',
        name: 'Ahmad',
        position: 'Designer',
        phone: '+567 2904 1934',
        email: 'ahmad@gmail.com',
        website: 'www.ahmadwebsite.com',
    },
    {
        id: 7,
        img: 'https://picsum.photos/75',
        name: 'Yassin',
        position: 'Tweaker',
        phone: '+345 678 902',
        email: 'yassin@gamil.com',
        website: 'www.yassinwebsite.com',
    },
]



const members = info.map(member => <TeamMember
    
            key={member.id}
            img={member.img}
            name={member.name}
            position={member.position}
            phone={member.phone}
            email={member.email}
            website={member.website}
    
    />);
    
    return(
        <div className="row">
            
            {members}

        </div>
    )
}

export default Team;
